const parallaxY=()=>{let e=document.getElementById("vegitableblack"),t=document.getElementById("vegitablecolor"),l=document.getElementById("pizza"),o=document.getElementById("flour"),n=document.getElementById("title"),c=document.getElementById("text"),d=document.getElementById("car"),r=document.getElementById("vf"),m=document.getElementById("icon");window.addEventListener("scroll",(function(){let s=window.scrollY;e.style.left=.15*s+"px",t.style.left=.15*-s+"px",l.style.top=.1*s+"px",o.style.top=.1*-s+"px",n.style.marginRight=1.05*s+"px",c.style.marginRight=1.05*-s+"px",d.style.left=-s/5*.7+"px",r.style.top=-s/1.5*.2+"px",m.style.top=.2*s+"px"}))};parallaxY();const scrollHeader=()=>{const e=document.querySelectorAll(".nav-item");console.log(e);for(let t of e)t.addEventListener("click",(function(e){e.preventDefault();const l=t.getAttribute("href");document.querySelector(""+l).scrollIntoView({behavior:"smooth",block:"start"})}))};scrollHeader();